import React from "react";
import { Form, Input } from "antd";

const dummy = {
  isLoggedIn: true
};

const Home = () => {
  return (
    <>
      {dummy.isLoggedIn && (
        <Form encType="multipart/form-data">
          <Input.TextArea
            maxLength={140}
            placeholder="Tell your story to share with Dear"
          />
        </Form>
      )}
    </>
  );
};

export default Home;
